(window.webpackJsonp=window.webpackJsonp||[]).push([[13],{"./src/markdown/pages/ranking.md":function(t,n,e){"use strict";e.r(n),e.d(n,"title",function(){return r});var o=e("./node_modules/react/index.js"),d=e.n(o);const r="Path Ranking";n.default=function(){return d.a.createElement("div",{className:"markdown",dangerouslySetInnerHTML:{__html:"<h1>Path Ranking</h1>\n<p>Reach router ranks your paths so you don’t have to worry about the order of your paths or pass in props to help it know how to match. Generally, you shouldn’t have to worry about this at all, just don’t think about it and it will do exactly what you want it to.</p>\n<p>However, I know you’re a programmer and so you want to know how it works.</p>\n<p>A path is assigned a score based on the value of each segment in the path. The path with the highest score that matches the location wins.</p>\n<ul>\n<li>Each segment gets 4 points and then…</li>\n<li>Static segments get 3 more points</li>\n<li>Dynamic segments 2 more</li>\n<li>Root segments 1</li>\n<li>and finally wildcard segments get a 1 point penalty</li>\n</ul>\n<p>Here’s a “table” showing different paths and their scores:</p>\n<table>\n<thead>\n<tr>\n<th>Score</th>\n<th>Path</th>\n</tr>\n</thead>\n<tbody>\n<tr>\n<td>5</td>\n<td><code>/</code></td>\n</tr>\n<tr>\n<td>7</td>\n<td><code>/groups</code></td>\n</tr>\n<tr>\n<td>13</td>\n<td><code>/groups/:groupId</code></td>\n</tr>\n<tr>\n<td>14</td>\n<td><code>/groups/mine</code></td>\n</tr>\n<tr>\n<td>19</td>\n<td><code>/groups/:groupId/users/\\*</code></td>\n</tr>\n<tr>\n<td>20</td>\n<td><code>/groups/:groupId/users</code></td>\n</tr>\n<tr>\n<td>21</td>\n<td><code>/groups/mine/users</code></td>\n</tr>\n<tr>\n<td>24</td>\n<td><code>/:one/:two/:three/:four</code></td>\n</tr>\n<tr>\n<td>26</td>\n<td><code>/groups/:groupId/users/:userId</code></td>\n</tr>\n<tr>\n<td>27</td>\n<td><code>/groups/:groupId/users/me</code></td>\n</tr>\n<tr>\n<td>28</td>\n<td><code>/groups/mine/users/me</code></td>\n</tr>\n<tr>\n<td>30</td>\n<td><code>/:one/:two/:three/:four/:five</code></td>\n</tr>\n</tbody>\n</table>\n<p>A URL like “/groups/mine” matches both paths “/groups/:groupId” and “/groups/mine”, but “/groups/mine” has 14 points while the other only has 13, so “/groups/mine” wins.</p>\n"}})}}}]);